import React from 'react';


interface Proyecto {
    title: string;
    description: string;
}
interface tarjetas {
    proyecto: Proyecto; 
}
const Tarjeta: React.FC<tarjetas> = ({proyecto}) => {
    return (
        <div className="project-card">
          <h2>{proyecto.title}</h2>
          <p>{proyecto.description}</p>  
        </div>
      );    
};
export default Tarjeta;
